    {
        imgUrl:videoImg,
        title: 'video',
        desc: 'To know about work. Watch some video f...',
        linkUrl: '#'
    }
]

const Blog = () => {
  return (
    <section>
        <div className="container">
            <div className="blog_top-content">
                <h6 className="subtitle">Our blog</h6>
                    <h2>
                        Let's have a look from our
                        <span className='highlight' > recent blog</span>
                    </h2>            
            </div>
            <div className="blog_wrapper">
                <div className="blog_item">
                    <h3>Video</h3>
                    <div className="blog_img">
                        <img src= {videoImg} alt="" />
                    </div>
                    <p className="description blog_desc">
                        To know about work. Watch some video f...
                    </p>
                    <div>
                        <a href="#" className="learn_more">
                            <i className="ri-arrow-right-line"></i>
                        </a>
                    </div>
                </div>
            </div>
        </div>
    </section>
  );
};

export default Blog;
